import React from 'react';

import TaskList from './components/TaskList';
import { Provider } from 'react-redux';

function App({ store }) {
  return (
    <Provider store={store}>
      <div className="App">
        <TaskList />
      </div>
    </Provider>
  );
}

export default App;
